import React from "react";

const Categories = ({items,hey}) => {
    return(
        <div>
            <div className="categories">
                <ul>
                    <li className="active">Все</li>

                    {items.map((name,i) => <li onClick={()=>hey(name)} key={`${name}_${i}`}>{name}</li>)}
                </ul>
            </div>
        </div>
    )
}

export default Categories;
